import React, { Component } from 'react';
import './NavLeft.css';
import { Jumbotron, Nav } from 'react-bootstrap';
import { NavLink } from 'react-router-dom';
//Nav, NavItem, Jumbotron, Grid, Row, Col, Image, Button

export default class NavLeft extends Component {
    render() {
        return (
            <div className="container-nav-left">

                <Nav default collapseOnSelect className="nav-left">
                    <h1 className="title-nav-left">Anastasia</h1>
                    <NavLink to="/" className="nav-left-link">Home</NavLink>
                    <NavLink to="/search" className="nav-left-link">Search</NavLink>
                    <NavLink to="/library" className="nav-left-link">Library</NavLink>
                    <NavLink to="/contact" className="nav-left-link">Contact</NavLink>
                    <NavLink to="/account" className="nav-left-link">Account</NavLink>
                </Nav>


            </div>


    );
}
}
